import React from "react";
import human from "../../../Image/human.jpg";
// import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";
import List from "../List/List";

const NavTop = () => {
  return (
    <>
      <img src={human} alt="" width="60" className="rounded-circle img-fluid" />
      <i className="fa fa-bars icon float-right"></i>
    </>
  );
};

export default NavTop;
